import Slider from '@mui/material/Slider';
import { styled } from '@mui/material/styles';

export const YTSlider = styled(Slider)({
	color: '#f00',
	height: 5,

	'& .MuiSlider-thumb': {
		height: 18,
		width: 18,
		backgroundColor: '#f00',
		border: '2px solid #f00',

		'&:hover': {
			boxShadow: '0 0 0 8px rgba(255, 0, 0, 0.25)',
		},
	},
	'& .MuiSlider-valueLabel': {
		lineHeight: 1.2,
		fontSize: 12,
		background: 'unset',
		padding: 12,
	},
});

const demo =
	'data:image/png;base64,';

export const SlideTooltipThumbBox = () => {
	return (
		<>
			<div className='border-[2px] border-white rounded-8px w-[280px] aspect-video'>
				<img className='w-full h-full' src={demo} />
			</div>
			<b>text</b>
		</>
	);
};
